INSERT INTO `details` (`place_name`, `hotel_name`, `hotel_image`, `hotel_price`, `hotel_description`) VALUES
('Chennai', 'Hotel Vivanta', 0x75706c6f6164732f686f74656c5f6368656e6e61695f566976616e74612e706e67, '5000.00', 'A comfortable and affordable hotel located near key attractions in Chennai, perfect for budget-conscious travelers. It offers clean and well-maintained rooms, complimentary breakfast, and easy access to public transportation.'),
('Chennai', 'Hotel PNG', 0x75706c6f6164732f686f74656c5f6368656e6e61695f706e672e6a7067, '3500.00', 'Located in the heart of Chennai, this luxury hotel offers world-class amenities, including a rooftop infinity pool, fine dining restaurants, and spacious rooms with stunning views of the city skyline. Ideal for business travelers and vacationers alike.'),
('Kodaikanal', 'Kodai Resort Hotel', 0x75706c6f6164732f4b6f646169205265736f727420486f74656c2e6a7067, '3061.00', 'Surrounded by gardens, this laid-back resort is a 6-minute walk from Bryant Park and 1 km from the Kodaikanal Lake. The airy, down-to-earth rooms with balconies feature living rooms with flat-screen TVs, minifridges and dining areas.'),
('Kodaikanal', 'Hotel GRT', 0x75706c6f6164732f47525420486f74656c2e6a7067, '7294.00', 'Set on a hillside overlooking the Gundar and Parappar valleys, this upmarket hotel is 7 km from Bryant Park and 8 km from Kodaikanal Lake.'),
('Yercaud', 'Cliff View Resort', 0x75706c6f6164732f436c6966662056696577205265736f72742e77656270, '2055.00', 'Very nice resort. Nice location. Tasty food. Very kind staffs. All are requests are done in short time. Definitely recommend. All the staffs were very kind and soft spoken.'),
('Yercaud', 'Hotel GVS', 0x75706c6f6164732f486f74656c204756532e77656270, '1328.00', 'Good stay, location and service. Breakfast served was good as well. Great for both families and friends.'),
('Ooty', 'The Byke Sunshine Grand Hotel', 0x75706c6f6164732f42796b652053756e7368696e65204772616e64204f6f74792e77656270, '4127.00', 'The hotel\'s location offers stunning views and a peaceful atmosphere, perfect for a relaxing getaway.'),
('Ooty', 'Destiny - The Farm Resort', 0x75706c6f6164732f44657374696e792d4661726d205265736f72742e77656270, '1330.00', 'Featuring valley and Avalanche Lake views, this casual, tranquil hotel on a working farm is 22 km from the Udhagamandalam railway station. It\'s 14 km from the Tribal Research Center.'),
('Yelagiri', 'Dolphin Resort', 0x75706c6f6164732f446f6c7068696e205265736f72742e6a7067, '2101.00', 'Excellent service, marvelous location . Tasty home made food. Highly recommended to all. Staff\'s are very kind and helping nature owner .'),
('Yelagiri', 'Ags Holiday Resort', 0x75706c6f6164732f41677320486f6c69646179205265736f72742e77656270, '3864.00', 'Surrounded by trees in a remote hill station, this laid-back resort is 1 km from Yelagiriâ€”Nature Park and 20 km from Jolarpettai Junction train station.'),
('Coonoor', 'De Rock Jungle Living', 0x75706c6f6164732f64652d726f636b2d6a756e676c652d6c6976696e672e6a7067, '5264.00', 'Coonoor, an idiomatic expression to describe De-Rock Jungle living. We want you to experience nature and embask in its glory, rid yourself of all worries.'),
('Coonoor', 'Kurumba Village Resort', 0x75706c6f6164732f6b7572756d62612d76696c6c6167652d7265736f72742e6a7067, '3150.00', 'The Kurumba Village Resort is located amidst a spice plantation of nutmeg, clove trees and pepper creepers surrounded by a tropical forests on all four sides. Luxury in the lap of nature is what we offer our guests at the resort.');

