('Kodaikanal', , 'Kodaikanal is one of the very popular holiday destination hill resorts in South India. This hill station stands 7200 feet above sea level and situated in upper palani hills of the westernghats near Madurai in Tamil Nadu. Kodaikanal is also popularly known', 'Kukkal Caves and Bryant Park', 'Silver Cascade Falls and Thalaiyar Falls', 'Pillar Rocks and Bear Shola Falls', 200, 500, 600, 800, 10.2392, 77.4977);
