INSERT INTO `place` (`name`, `image`, `description`, `schedule_1`, `schedule_2`, `schedule_3`, `veg`, `nonveg`, `car`, `bus`, `place_lat`, `place_lng`) VALUES
('Ooty', , 'It is a popular hill resort in the state of Tamil Nadu in Southern India. The name Udhagamandalam is derived from the Toda word \"othakal-mund\" which means \"house in mountains\". Ooty stands at 2,240 m (7,347 feet) above sea level in the Nilgiri mountain ra', 'Ooty Botanical Garden and Ooty Rose Garden', 'Kalhatti Falls and Thread Garden', 'Doddabetta Peak and Dolphins Nose', 150, 400, 500, 750, 11.4112, 76.695);
INSERT INTO `place` (`name`, `image`, `description`, `schedule_1`, `schedule_2`, `schedule_3`, `veg`, `nonveg`, `car`, `bus`, `place_lat`, `place_lng`) VALUES
('Coonoor', , 'Coonoor is a hill station in Tamil Nadu, India, with many attractions, including viewpoints, hills, waterfalls, tea plantations, valleys, and churches', 'Lamb\'s Rock and High Field Tea Factory', 'Tiger Hill Cemetary and Laws Falls', 'Ketti Valley and Kattery Water Falls', 150, 500, 1000, 2000, 11.3447, 76.7937);
INSERT INTO `place` (`name`, `image`, `description`, `schedule_1`, `schedule_2`, `schedule_3`, `veg`, `nonveg`, `car`, `bus`, `place_lat`, `place_lng`) VALUES
('Yelagiri', , 'Yelagiri is a hill station in the Tirupathur district of Tamil Nadu, India, with many attractions including a lake, temples, and scenic points', 'Fundera Park and Cloud Forest Entertainment Park', 'Puganur Lake and Swamimalai Hills', 'Thrill Valley and Jalagamparai Falls', 200, 1000, 1500, 3000, 12.5862, 77.6433);
